// @ts-nocheck
import Vue from 'vue'
import Router from 'vue-router'

Vue.use(Router)

var router = new Router({
    saveScrollPosition: true,
    history: true,
    // mode: 'history',
    routes: [{
        path: '/',
        redirect: to => {
            return '/index'
        }
    },
    {
        path: '/',
        meta: { auth: [1, 100, 1000] },
        component: () =>
            import('@/layouts/main.vue'),
        children: [{
            path: '/profile',
            name: 'profile',
            meta: { 'title': 'Мой профиль', auth: [1, 50, 100, 1000] },
            component: () =>
                import('@/views/signup/profile.vue'),
        },
        {
            path: '/index',
            name: 'index',
            meta: { 'title': 'Кабинет', auth: [1, 50, 100, 1000] },
            component: () =>
                import('@/views/index/index.vue'),
        },


        {
            path: '/users',
            name: 'users',
            meta: { 'title': 'Пользователи', auth: [50, 100, 1000] },
            component: () =>
                import('@/views/users/index.vue')
        },
        {
            path: '/users/view/:id',
            name: 'users_view',
            meta: { 'title': 'Пользователи', auth: [50, 100, 1000] },
            component: () =>
                import('@/views/users/view.vue')
        },
        {
            path: '/users/update/:id',
            name: 'users_update',
            meta: { 'title': 'Пользователи', auth: [1, 50, 1000] },
            component: () =>
                import('@/views/users/form.vue')
        },
        {
            path: '/users/create',
            name: 'users_create',
            meta: { 'title': 'Пользователи', auth: [1, 50, 1000] },
            component: () =>
                import('@/views/users/form.vue')
        },


        {
            path: '/help',
            name: 'help',
            meta: { 'title': 'Помощь', auth: [1, 50, 100, 1000] },
            component: () =>
                import('@/views/help/index.vue')
        },

        {
            path: '/configs',
            name: 'configs',
            meta: { 'title': 'Конфигурация', auth: [1000] },
            redirect: to => {
                return { name: 'configs_dic_sp' }
            },
            component: () =>
                import('@/views/configs/index.vue'),
            children: [{
                path: '/configs/dic_sp',
                name: 'configs_dic_sp',
                meta: { 'title': 'Виды специализаций', auth: [1000] },
                component: () =>
                    import('@/views/configs/dic_sp/index.vue')
            },
            {
                path: '/configs/dic_kab',
                name: 'configs_dic_kab',
                meta: { 'title': 'Кабинеты', auth: [1000] },
                component: () =>
                    import('@/views/configs/dic_kab/index.vue')
            }]
        }
        ]
    },
    {
        path: '/',
        component: () =>
            import('@/layouts/blank.vue'),
        children: [{
            path: '/login',
            name: 'login',
            meta: { 'title': 'login', auth: ['0'] },
            component: () =>
                import('@/views/signup/login.vue')
        },
        {
            path: '*',
            name: 'notfound',
            meta: { 'title': '404', auth: ['*'] },
            component: () =>
                import('@/views/notFound.vue')
        }
        ]
    }
    ]
})
export default router
